import { Redirect } from 'react-router-dom';
import './index.css';

class Home extends Component {

    state = {
        item: '',
        dateFrom: '',
        dateTo: '',
        Location: '',
    }

    constructor(props) {
        super(props);
        console.log("");
    }

    componentDidMount() {
        console.log("");
    }

    componentDidUpdate() {
        console.log("");
    }

    componentWillUnmount() {
        console.log("");
    }

    changesState() {

    }

    handleChange = (event) => {
        const { name, value } = event.target
        console.log(name);
        console.log(value);
        //this.setState({
         // [name]: value,
        //})
        //console.log(this.state);
      }

    formSubmission(e) {
        e.preventDefault();
        console.log(e.target.value);
    }

    render() {
        const { item, dateFrom, dateTo, location } = this.state;

        return (
            <main>
                <h1></h1>
                <form type="submit">

                    <span><input
                        type="text"
                        name="item"
                        id="item"
                        value={item}
                        onChange={(e) => this.handleChange(e)} />
                    </span>



                    <span><input name='dateFrom' onChange={(e) => this.handleChange(e)} type="text" placeholder="Date From (dd/mm/yyyy)" value={dateFrom} /></span>
                    <span><input name='dateTo' onChange={(e) => this.handleChange(e)} type="text" placeholder="Date To (dd/mm/yyyy)" value={dateTo} /></span>
                    <span><input name='location' onChange={(e) => this.handleChange(e)} type="text" placeholder="Location" value={location} /></span>
                    <span><button onClick={(e) => this.formSubmission(e)} >Click Me!</button></span>
                </form>
            </main>
        );
    }
}

export default Home;
